import React from "react";
import Button from "./Re-usable/Button";
import { Link } from "react-router-dom";
import {organById} from '../Components/OrgansService.js'
import { useParams } from "react-router-dom";

const OrganList = ({organs, organById}) => {
    const { id } = useParams()
    const organList = organs.map(organ => {
        return (
        <div key={organ._id}>
       <Button onClick={() => organById(id)} text={organ.name} />
        </div>)
    })



    return ( 
        <section>
            <h2>Choose your organ:</h2>
            <ul>
                {organList}
            </ul>
        </section>
     );
}

export default OrganList;
